import React from 'react'

function KeyBoard() {
    const KeyBoard = [
        [1,2,3],
        [4,5,6],
        [7,8,9]
    ]

    return (
    <div className='keyboard'>
        {
            KeyBoard.map( (row, key) => (
                <div className='row-container' key={key}>
               {
                    row.map( (key, index) =>(
                            <span className='keyboard--key' key={`${index}-key`}>{key}</span>                    
                    ))
                    }
             </div>
            ) )
                }
    </div>
  )
}

export default KeyBoard
